import React, { Component } from 'react';

class AppTFReact extends Component{
    render() {
        return (
            <div > 
                <h3> Build an APP in React Native for Image Recognition with TensorFlow</h3>
                <p>On February 04, 2020, TensorFlow posted a <a href="https://blog.tensorflow.org/2020/02/tensorflowjs-for-react-native-is-here.html">blog</a> 
                 formally announcing its support for React Native. The Google Brain Team developed a new  platform of integration suited to the React Native environment. 
                The tfjs-react-native package supports GPU backend, Model Loading and Saving, Training, Image &amp Video Handling. In this blog, we will mainly talk about 
                how to deploy a pre-trained model of image classification in React-Native for offline image recognition.    
                </p>

                <h5>Introduction & Motivation </h5>
                <p></p>

                <h5>Model Preparation </h5>

                <h5>Deployment in React Native</h5>


                <iframe width="560" height="315" 
                    src="https://www.youtube.com/embed/dNqdTC97NVM" frameborder="0" 
                    allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" 
                    allowfullscreen title='Video: Demo mobile APP for Image Recognition by taking photos '> 
                    <p> 
                        <a href="https://www.youtube.com/embed/dNqdTC97NVM">
                        Fallback link for browsers that don't support iframes
                        </a>
                    </p>
                </iframe>

            </div>

        );
    }
}

export default AppTFReact;
